import os
from PIL import Image
from io import BytesIO
import base64

def decode_image(base64_data, name):
    img_data = base64_data.split(",")[1]
    binary_data = base64.b64decode(img_data)
    img = Image.open(BytesIO(binary_data))
    img.save(name)

directory = os.path.join(os.path.dirname(__file__), "Assets\\General Images\\")
images = []
images.append("data:image/png;base64,")
images.append("data:image/png;base64,")
images.append("data:image/png;base64,")
images.append("data:image/png;base64,")
images.append("data:image/png;base64,")
rarities = ["Common", "Uncommon", "Rare", "Very Rare", "Ultra Rare"]
i = 0
for image, rarity in zip(images, rarities):
    decode_image(image, f"{directory}{rarity}.png")
    i += 1
print(i)